import React, { Component, Fragment } from 'react';
import NavBar from './NavBar';

import {
    Card, Button, CardImg, CardTitle, CardText, CardGroup,
    CardSubtitle, CardBody
} from 'reactstrap';
import './App.css';
import Paques from './images/Paques.jpg';
import Yoshilogo from './images/Yoshilogo.png';
import Logo from './images/Logo.png';
import Background from './images/Background.jpg';
import { url } from 'inspector';



class Works extends Component {
    constructor(props) {
        super(props);
        this.state = {
            url: 'http://eggsplosive.herokuapp.com/',
        }
    }


    handleClick(event) {
        this.setState = event.target.value;
    }

    render() {
        return (
            <Fragment>
                <NavBar />
                <div className='Block'>
                    <h1 className='Titles'>Réalisations</h1>
                    <br />
                    <br />
                    <CardGroup>
                        <Card>
                            <CardImg top width="100%" src={Background} alt="Card image cap" />
                            <CardBody className='CardBody' >
                                <CardTitle>PokeReact</CardTitle>
                                <CardText>Réalisation en équipe d’un jeu vidéo multijoueur Pokémon en Javascript/React (5 semaines). </CardText>
                                <Button onClick={'https://wildcodeschool.github.io/lyon-0219-react-PokeReact/#/'}>Button</Button>
                            </CardBody>
                        </Card>
                        <Card>
                            <CardImg top width="100%" src={Paques} alt="Card image cap" />
                            <CardBody className='CardBody'>
                                <CardTitle>EggsPlosives</CardTitle>
                                <CardText>Hackaton 24h : Réalisation en équipe d’un jeu en Javascript/React à partir d’une API sur le thème de Pâques. </CardText>
                                <Button onClick={this.handleClick}>Button</Button>
                            </CardBody>
                        </Card>
                        <Card>
                            <CardImg top width="100%" src={Background} alt="Card image cap" />
                            <CardBody className='CardBody'>
                                <CardTitle>Portfolio</CardTitle>
                                <CardText>Réalisation de mon Portfolio.</CardText>
                                <Button>Button</Button>
                            </CardBody>
                        </Card>
                        <Card>
                            <CardImg top width="100%" src={Background} alt="Card image cap" />
                            <CardBody className='CardBody'>
                                <CardTitle>Yoshi : Save the Baby !</CardTitle>
                                <CardText>Réalisation en équipe d’un site de vente en ligne (3 semaines). Utilisation d'Html, CSS, Bootstrap et Javascript Vanilla.</CardText>
                                <Button>Button</Button>
                            </CardBody>
                        </Card>
                    </CardGroup>
                </div>
            </ Fragment >
        );
    }
}

export default Works;
